import React, { Component } from 'react';
import { Link } from 'react-router-dom';
import { Dropdown, Input, Grid, Segment, Tab } from 'semantic-ui-react';
import './Main.css';

const REACT_VERSION = React.version;

const panes = [
    { menuItem: 'Force Display', render: () => <Tab.Pane>Force Display</Tab.Pane> },
    { menuItem: 'Bar Display', render: () => <Tab.Pane>Bar Display</Tab.Pane> },
]

const tagOptions = [
    {
      key: 'Important',
      text: 'Important',
      value: 'Important',
      label: { color: 'red', empty: true, circular: true },
    },
    {
      key: 'Announcement',
      text: 'Announcement',
      value: 'Announcement',
      label: { color: 'blue', empty: true, circular: true },
    },
    {
      key: 'Cannot Fix',
      text: 'Cannot Fix',
      value: 'Cannot Fix',
      label: { color: 'black', empty: true, circular: true },
    },
    {
      key: 'News',
      text: 'News',
      value: 'News',
      label: { color: 'purple', empty: true, circular: true },
    },
    {
      key: 'Enhancement',
      text: 'Enhancement',
      value: 'Enhancement',
      label: { color: 'orange', empty: true, circular: true },
    },
    {
      key: 'Change Declined',
      text: 'Change Declined',
      value: 'Change Declined',
      label: { empty: true, circular: true },
    },
    {
      key: 'Off Topic',
      text: 'Off Topic',
      value: 'Off Topic',
      label: { color: 'yellow', empty: true, circular: true },
    },
    {
      key: 'Interesting',
      text: 'Interesting',
      value: 'Interesting',
      label: { color: 'pink', empty: true, circular: true },
    },
    {
      key: 'Discussion',
      text: 'Discussion',
      value: 'Discussion',
      label: { color: 'green', empty: true, circular: true },
    },
]

class Main extends Component {

    constructor(props) {
    super(props);
        this.state = {
        }
    };

    componentDidMount() {
    };

    render () {

        return (
            <div>
                <Grid >
                    <Grid.Row> </Grid.Row>
                    <Grid.Row>
                        <Grid.Column>
                            <div className="Main-header">
                                <p>Erdos Number Display </p>
                            </div>
                        </Grid.Column>
                    </Grid.Row>

                    <Grid.Row columns={3}>
                        <Grid.Column></Grid.Column>
                        <Grid.Column></Grid.Column>
                        <Grid.Column>
                            <Dropdown
                                text='Filter Posts'
                                icon='filter'
                                floating
                                labeled
                                button
                                className='icon'
                            >
                                <Dropdown.Menu>
                                    <Input icon='search' iconPosition='left' className='search' />
                                    <Dropdown.Divider />
                                    <Dropdown.Header icon='tags' content='Tag Label' />
                                    <Dropdown.Menu scrolling>
                                        {tagOptions.map((option) => (
                                        <Dropdown.Item key={option.value} {...option} />
                                        ))}
                                    </Dropdown.Menu>
                                </Dropdown.Menu>
                            </Dropdown>
                        </Grid.Column>
                    </Grid.Row>

                    <Grid.Row>
                        <Grid.Column>
                            <div className="d3_tab_display">
                                <Tab panes={panes} />
                            </div>
                        </Grid.Column>
                    </Grid.Row>

                    <Grid.Row>
                        <Grid.Column>
                            <Link to="/about">About</Link>
                        </Grid.Column>
                        <Grid.Column>
                            <Link to="/messages">Messages</Link>
                        </Grid.Column>
                    </Grid.Row>

                </Grid>
            </div>
        );
    }
}

export default Main;
